import React, { useState, useEffect } from 'react';

function PincodeLocation(props) {
    const [locationData, setLocationData] = useState(null);

    const fetchLocationData = async (pincode) => {
        const apiKey = 'YOUR_API_KEY';
        const apiUrl = `https://nominatim.openstreetmap.org/search?postalcode=831001`;

        try {
            const response = await fetch(apiUrl);
            const data = await response.json();
            setLocationData(data);
        } catch (error) {
            console.error('Error fetching location data:', error);
        }
    };

    useEffect(() => {
        if (props.pincode) {
            fetchLocationData(props.pincode);
        }
    }, [props.pincode]);

    return (
        <div>
            {props.pincode && (
                <div>
                    <h2>Pincode: {props.pincode}</h2>
                    {locationData && (
                        <div>
                            <h3>Location Information</h3>
                            {locationData}
                        </div>
                    )}
                </div>
            )}
        </div>
    );
}

export default PincodeLocation;
